import React from 'react'
import logo from './googlelogo_color.png';
import whitelogo from './googlelogo_white.png';
import './style.css';

function Logo() {
  return (
    <>
    <div class="logocontainer">
      <img src={whitelogo} alt="logo" class="logo" />
    <picture alt="logo" class="logo" />
    </div>
    </>
  )
}

export default Logo
